import React, { useEffect, useState } from "react";
const Vans = () => {
  const [vans, setVans] = useState([]);

  useEffect(() => {
    fetch("/api/vans")
      .then((res) => res.json())
      .then((data) => setVans(data.vans));
  }, []);

  const vansElements = vans.map((van) => <div className=""></div>);
  return <div className="items">{vansElements}</div>;
};

export default Vans;
